import React from "react";
import { MaterialTable } from "material-table";
function Product() {
  return (
    <MaterialTable
      detailPanel={[
        {
          tooltip: "Show Name",
          render: (rowData) => {
            return (
              <div
                style={{
                  fontSize: 100,
                  textAlign: "center",
                  color: "white",
                  backgroundColor: "#43A047",
                }}
              >
                {rowData.name}
              </div>
            );
          },
        },
        {
          icon: "account_circle",
          tooltip: "Show Surname",
          render: (rowData) => {
            return (
              <div
                style={{
                  fontSize: 100,
                  textAlign: "center",
                  color: "white",
                  backgroundColor: "#E53935",
                }}
              >
                {rowData.surname}
              </div>
            );
          },
        },
        {
          icon: "favorite_border",
          openIcon: "favorite",
          tooltip: "Show Both",
          render: (rowData) => {
            return (
              <div
                style={{
                  fontSize: 100,
                  textAlign: "center",
                  color: "white",
                  backgroundColor: "#FDD835",
                }}
              >
                {rowData.name} {rowData.surname}
              </div>
            );
          },
        },
      ]}
    />
  );
}

export default Product;
